package com.raychenon.kotlin.leetcode

import org.junit.Assert
import org.junit.Test

/**
 * User: raychenon
 * Date: 2019-10-03
 * https://leetcode.com/problems/find-all-anagrams-in-a-string/
 */
class FindAllAnagramsInaStringTest {

    @Test
    fun find_ABC_Test() {
        val expected = listOf(0, 6)
        Assert.assertEquals(expected, FindAllAnagramsInaString.findAnagrams("cbaebabacd", "abc"))
    }

    @Test
    fun find_AB_Test() {
        val expected = listOf(0, 1, 2)
        Assert.assertEquals(expected, FindAllAnagramsInaString.findAnagrams("abab", "ab"))
    }
    
    @Test
    fun superLonStringTest() {
        val expected = listOf(0, 10001)
        Assert.assertEquals(
            expected, FindAllAnagramsInaString.findAnagrams(
                "",
                ""
            )
        )
    }


}